module.exports = function myFunc(courseNumber, callback) {

formatData();
function formatData(){
	//lists the keys for each department
	var departmentKeys = Object.keys(classData);
	for (var i = 0; i < departmentKeys.length; i++){
		//prints out departments
		//console.log(departmentKeys[i]);
		//prints out classes for the current department
		var classKeys = Object.keys(classData[departmentKeys[i]]);
		for(var j = 0; j < classKeys.length; j++){
				if(!(classData[departmentKeys[i]].hasOwnProperty(classKeys[j].substring(0,4))))	{
			//console.log(classData[departmentKeys[i]]);
					var key = classKeys[j].replace(classKeys[j],classKeys[j].substring(0, 4));
					var value = classData[departmentKeys[i]][classKeys[j]];
					delete classData[departmentKeys[i]][classKeys[j]];
					classData[departmentKeys[i]][key] = value;

				}
			//console.log(classData[departmentKeys[i]]);

		}
	}
}
var rts = courseNumber.split(" ");
var profs = getProfs(rts[0], rts[1]);
if (profs == null) {
	callback("Not found in database. Ensure spelling.")
}
var percentages = getPercentages(rts[0], rts[1]);
ratings(profs, percentages, function(res) {
	// Very final result'

	// console.log(res);

	var resCopy = res.concat([]);
	console.log(resCopy);
	resCopy.sort();
	var profsCopy = [];
	for (var i = resCopy.length - 1; i > -1; i--) {
		var index = res.indexOf(resCopy[i]);
		profsCopy.push(profs[index]);
	}

	callback(profsCopy);
});


function getProfs(department, courseNumber){
	if (courseNumber.length === 3)
		courseNumber += " ";
	try{

		var classKeys = Object.keys(classData[department]);
		var profList = Object.keys(classData[department][courseNumber]);

	}
	catch(err){
		return null;
	}

	var finalProf = [];
	for (var i = 0; i < profList.length; i++) {
		var splitName = profList[i].split(" ");
		var finalName = splitName[1] + " " + splitName[0].replace(",", "");
		finalProf.push(finalName);
	}

	//console.log(finalProf);
	return finalProf;
}

function getPercentages(department, courseNumber) {
	if (courseNumber.length === 3)
		courseNumber += " ";
	var profList = Object.keys(classData[department][courseNumber]);
	var gradePercentages = [];
	for (var i = 0; i < profList.length; i++) {
		var totalStudents = 0;
		var gradeArr = classData[department][courseNumber][profList[i]];
		for (var k = 0; k < 12; k++) {
			totalStudents += gradeArr[k];
		}
		var currPercentages = [];

		for (var l = 0; l < 12; l++) {
			currPercentages.push(gradeArr[l] / totalStudents * 100);
		}
		gradePercentages.push(currPercentages);

	}
	//console.log(gradePercentages);
	return gradePercentages;
}

function ratings(array, percentages, callback) {
	overallRating(array, function(res) {
		var sum = 0.0;
		for (var i = 0; i < res.length; i++) {
			if (res[i] != -1)
				sum += res[i];
		}
		var avg = sum / res.length;

		var scores = [];

		var index = -1;
		var best = -0.1;
		for (var i = 0; i < array.length; i++) {
			if (res[i] === -1) {
				res[i] = avg;
			}
			var gpa = [4, 3.67, 3.33, 3, 2.67, 2.33, 2, 1.67, 1.33, 1, 0.67, 0];
			var avgGpa = 0;
			for (var j = 0; j < percentages[i].length; j++) {
				avgGpa += percentages[i][j] * gpa[j];
			}
			avgGpa /= 100.0;
			avgGpa = avgGpa * 5.0 / 4.0;

			var score = avgGpa + res[i];
			scores.push(score);

			/*if (score > best) {
				best = score;
				index = i;
			}*/
		}

		callback(scores);

	});
}

//Gets an array of ratings
function overallRating(array, callback) {
	var json = {};
	// Goes through list of professors
	for (var i = 0; i < array.length; i++) {
		var name = array[i];
		name = name.replace(" ", "+");
		// Link to query Rate My Professors
		var link = "http://www.ratemyprofessors.com/search.jsp?queryoption=HEADER&queryBy=teacherName" +
			"&schoolName=University+of+Texas+at+Austin&schoolID=1255&query=" + name;

		// Queries the link to the professor search results
		Request(link, function(err, resp, body) {
			if (!err && resp.statusCode == 200) {
				var $ = Cheerio.load(body);

				// Checks if any results are found
				var htmas = $("div.not-found-box").next().html();
				if (!htmas.includes("Your search")) {
					// Gets the link for the first result
					$(".listings").filter(function() {
						var endLink = $($(this)[0].children[3].children[1]).attr("href");
						var link2 = "http://www.ratemyprofessors.com" + endLink;

						// Queries the link to the professor's page
						Request(link2, function(error, response, html) {
							if (!error && response.statusCode == 200) {
								var $ = Cheerio.load(html),
								overallQuality = $("[class='breakdown-container quality'] .grade").html();
								if (overallQuality != null) {
									var overallQuality = overallQuality.replace(/\s+/g, "");
									firstName = $(".pfname").html();
									lastName = $(".plname").html();
									var firstName = firstName.replace(/\s+/g, "");
									var lastName = lastName.replace(/\s+/g, "");
									//console.log(firstName + " " + lastName + " " + overallQuality);
									json[lastName.toUpperCase()] = overallQuality;
								} else {
									var overallQuality = -1.0;
									name = $("div.name").html();
									//console.log(name + " " + overallQuality);
									var i = name.indexOf(" ");
									json[name.substring(i + 1).toUpperCase()] = overallQuality;
								}
							}
						});
					});
				} else {
					// No results found in Rate My Professors
					//console.log("Doesn't matter" + " " + -1.0);
				}
			}
		});
	}

	// Converts json to array after 5 seconds
	setTimeout(function() {
		var arr = [];
		for (var i = 0; i < array.length; i++) {
			var index = array[i].indexOf(" ");
			if (json[array[i].substring(index + 1)] == null)
				arr[i] = -1;
			else
				arr[i] = parseFloat(json[array[i].substring(index + 1)]);
		}
		callback(arr);
	}, 8000);
}
}
